sympy.sympy.polys.polyclasses.integrate:
def integrate(f, m: int = 1, j: int = 0) -> Self:
    """Computes the ``m``-th order indefinite integral of ``f`` in ``x_j``. """
    if not isinstance(m, int):
        raise TypeError("``int`` expected, got %s" % type(m))

    if not isinstance(j, int):
        raise TypeError("``int`` expected, got %s" % type(j))

    return f._integrate(m, j)

sympy.sympy.polys.polytools._gen_to_leve:
def _gen_to_level(f, gen):
    """Returns level associated with the given generator. """
    if isinstance(gen, int):
        length = len(f.gens)

        if -length <= gen < length:
            if gen < 0:
                return length + gen
            else:
                return gen
        else:
            raise PolynomialError("-%s <= gen < %s expected, got %s" %
                                  (length, length, gen))
    else:
        try:
            return f.gens.index(sympify(gen))
        except ValueError:
            raise PolynomialError(
                "a valid generator expected, got %s" % gen)

sympy.sympy.polys.polytools.per:
def per(
    f, rep: DMP, gens: tuple[Expr, ...] | None = None, remove: int | None = None
) -> Poly | Expr:
    """
    Create a Poly out of the given representation.

    Examples
    ========

    >>> from sympy import Poly, ZZ
    >>> from sympy.abc import x, y

    >>> from sympy.polys.polyclasses import DMP

    >>> a = Poly(x**2 + 1)

    >>> a.per(DMP([ZZ(1), ZZ(1)], ZZ), gens=[y])
    Poly(y + 1, y, domain='ZZ')

    """
    if gens is None:
        gens = f.gens

    if remove is not None:
        gens = gens[:remove] + gens[remove + 1:]

        if not gens:
            return f.rep.dom.to_sympy(rep)

    return f.__class__.new(rep, *gens)
